  open_rate: !ruby/object:BigDecimal 18:0.4346E3
  strike: !ruby/object:BigDecimal 18:0.4346E3
  rate: 
  close_rate: !ruby/object:BigDecimal 18:0.43502E3
  payout: 80
  order_id: 58913936
  open_picture: TopOption.png
  close_picture: FTI 2015-10-05 12.30.06.png
  description: |
    На энтузиазме от успешности первой сделки я открываю вторую позицию.
    Сейчас, когда я пишу, сделка еще в пути. Сразу же главное: эмоции заставляют ошибаться.
    Вот список моих ошибок в этой сделке:
    * чисто техническая ошибка - курс у брокера заморозился на 434.60, в реальности в момент поукупки он был около 435
      - я не обратил на это внимания торопясь войти в игру
    * индикаторы macd и sar не давали сигналов на покупку
      - я поспешил интепретировать rsi и bol в свою пользу из-за желания отиграться за неудачи прошлой недели
      и сделать деньги сегодня
    * сегдня мы открылись с гэпом вверх и движемся в том же направлении - я же снова инраю развороты
    * изменения курса в AEX на данный момент около 3% - по моим правилам в токой ситуации надо или не играть
      или входить по тренду
    * я открыл позицию в 12 часов - после времени окончания моей торговли
    * сделка открыта на границе часа, что является дополнительным фактором риска
    * я не отслеживаю сегодняшние новости
    * в понедельники я не торгую - наиболее убыточные дни для меня - и это правило я нарушил
    Я действительно буду удивлен если она чудом окажется в плюсе.
    Все - сделка закрылась и чуда не случилось. Впервые данные по AEX очень различались у TopOption (заморозка) и IB

