  description: |
    Решил с утра пораньше заработать. Австралиец сильно вырос из-за новостей.
    Я поститал, что уж достаточно вырос и надо начать уже ему падать.
    Вошел в сделку, основываясь на bol и macd, в то время как sar и ma не дают сигнала вниз, rsi нейтрален.
    Хотел войти на более короткий период, но брокер в утренние часы не позволяет этого делать.
    Выплаты утром почему-то тоже очень малы - 76% против дневных 80%.
    Вначале все было хорошо и я оставил сделку на пол-часа. Вернувшись обнаружил швах!
    Резюмирую - торговля только в мои рабочие часы: 9-12.

